import React from 'react';
import './Zippers.css'

function Zipper() {
  return (
    <div className='zipper-container'>
      <div className='zipper-element'>
        <img src="/fashion_ave.jpg" alt="st sign"/>
      </div>
      <div className='zipper-text'>
        <p>Test</p>
      </div>
      <hr></hr>
      <div>
        <p>Test</p>
      </div>
    </div>
  )
}



export default Zipper;
